import React from "react";
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn,
} from "mdb-react-ui-kit";
import { MDBTypography } from 'mdb-react-ui-kit';
import { MDBRow, MDBCol, MDBIcon, MDBBadge } from "mdbreact";

export default function Home() {
  return (
    <div className="row">
        <div className="col-md-6">
          <MDBCard className="card ml-3 mt-5" style={{ width: "18rem" }}>
            <MDBCardImage
              src="https://online-auction.state.gov/Image/Get?id=8334df7d-dc13-4930-b532-98c0489145ba&size=2"
              position="top"
              alt="..."
              className="card-img-top"
            />
            <MDBCardBody className="card-body text-center">
              <MDBCardTitle>Login to see Bid Status</MDBCardTitle>
              <MDBBtn href="" className="btn btn-primary">
                VIEW THIS LOT
              </MDBBtn>
            </MDBCardBody>
          </MDBCard>
      </div>
      <div className=" mt-5">
      <MDBTypography tag='h3' >Printers - AG0232X AG0976B AG0976C AG1000G AG1001G</MDBTypography>
      </div>
    </div>
  );
}
